import React from 'react';
import { Link } from 'react-router-dom';


export function NavBar() {
    return (
        <nav >

        <Link to='/'> 
        <span className='name'>
          iWorld!
        </span>
        </Link>
        <Link to='/About'>
          <span>About</span>
        </Link>
    </nav>
    )
};

export default NavBar
